import { useState, useMemo, useCallback } from "react";
import Drawer from "./Drawer";
import PortalDrawer from "./PortalDrawer";

const KanbanLane = ({
  todoText,
  completedText,
  todoInputText,
  todoInput,
  completedInputText,
  todoInputSize,
  cardContentJustifyContent,
  postTheVideoColor,
  frameOverflow,
  frameFlexShrink,
}) => {
  const frameDivStyle = useMemo(() => {
    return {
      justifyContent: cardContentJustifyContent,
    };
  }, [cardContentJustifyContent]);

  const toDoStyle = useMemo(() => {
    return {
      color: postTheVideoColor,
    };
  }, [postTheVideoColor]);

  const frameIconStyle = useMemo(() => {
    return {
      overflow: frameOverflow,
      flexShrink: frameFlexShrink,
    };
  }, [frameOverflow, frameFlexShrink]);

  const [isDrawerOpen, setDrawerOpen] = useState(false);

  const openDrawer = useCallback(() => {
    setDrawerOpen(true);
  }, []);

  const closeDrawer = useCallback(() => {
    setDrawerOpen(false);
  }, []);

  return (
    <>
      <div className="self-stretch flex-1 flex flex-col items-center justify-center text-left text-sm text-darkslategray-200 font-inter md:flex-[unset] md:self-stretch">
        <div className="self-stretch flex flex-row items-center justify-between">
          <div
            className="flex flex-row items-center justify-center gap-[7px]"
            style={frameDivStyle}
          >
            <img
              className="relative w-4 h-4"
              alt=""
              src={todoText}
              style={frameIconStyle}
            />
            <input
              className="[border:none] font-medium font-inter text-xs bg-[transparent] relative leading-[21px] text-gray text-left"
              type="text"
              placeholder={completedText}
              maxLength
              minLength
              style={toDoStyle}
            />
            <div className="relative leading-[21px] flex items-center w-2 h-4 shrink-0">
              0
            </div>
          </div>
          <button className="cursor-pointer [border:none] p-1 bg-gray-50 rounded-md flex flex-col items-start justify-start">
            <img
              className="relative w-[12.03px] h-3 overflow-hidden shrink-0"
              alt=""
              src={todoInputText}
            />
          </button>
        </div>
        <div className="self-stretch flex-1 rounded-xl flex flex-col p-3 items-start justify-start">
          <div className="self-stretch rounded-lg bg-white shadow-[0px_2px_4px_rgba(0,_0,_0,_0.08)] flex flex-col p-4 items-center justify-center gap-[8px] border-[1px] border-solid border-gainsboro-100 [&_.simple-buttons]:hover:flex">
            <div className="self-stretch flex flex-row py-1.5 px-0 items-center justify-center relative gap-[33px]">
              <div className="self-stretch flex-1 flex flex-row items-center justify-start z-[0]">
                <div className="self-stretch flex-1 flex flex-row items-center justify-start">
                  <input
                    className="[border:none] font-inter text-sm bg-[transparent] flex-1 relative tracking-[-0.2px] font-bold text-black text-left"
                    type="text"
                    placeholder={todoInput}
                    maxLength
                    minLength
                  />
                </div>
              </div>
              <button
                className="simple-buttons cursor-pointer p-0 bg-white my-0 mx-[!important] absolute top-[3.06px] right-[-0.33px] rounded-10xs shadow-[0px_2px_4px_rgba(0,_0,_0,_0.08)] box-border w-[88px] h-[29px] hidden flex-row items-center justify-center z-[1] border-[1px] border-solid border-gainsboro-100 hover:flex"
                autoFocus
                onClick={openDrawer}
              >
                <div className="self-stretch flex-1 flex flex-row items-center justify-center border-r-[1px] border-solid border-gainsboro-200">
                  <img
                    className="relative w-[11.9px] h-[12.75px]"
                    alt=""
                    src={completedInputText}
                  />
                </div>
                <div className="flex-1 flex flex-row items-center justify-center">
                  <img
                    className="relative w-7 h-[5px]"
                    alt=""
                    src={todoInputSize}
                  />
                </div>
              </button>
            </div>
            <textarea className="[border:none] bg-[transparent] self-stretch h-[38px] overflow-hidden shrink-0" />
          </div>
        </div>
      </div>
      {isDrawerOpen && (
        <PortalDrawer
          overlayColor="rgba(113, 113, 113, 0.3)"
          placement="Right"
          onOutsideClick={closeDrawer}
        >
          <Drawer onClose={closeDrawer} />
        </PortalDrawer>
      )}
    </>
  );
};

export default KanbanLane;
